
import React from 'react';
import { SettingsRow } from '../components/SettingsRow';
import { ToggleButton } from '../components/ToggleButton';
import { BookOpen } from 'lucide-react';
import { usePopup } from '../contexts/PopupContext';
import { descriptions } from '../data/descriptions';

const carImageBase64 = "data:image/png;base64,";

// Componente per la visualizzazione della pressione dei pneumatici
const TirePressureDisplay: React.FC<{ pressure: string; time: string; position: string }> = ({ pressure, time, position }) => (
  <div className={`absolute text-center ${position}`}>
    <p className="font-bold text-lg text-gray-800">{pressure}</p>
    <p className="text-xs text-gray-500">{time}</p>
  </div>
);

// Pulsante per la griglia dei servizi
const ServiceGridButton: React.FC<{ label: string; icon?: React.ElementType; onClick: () => void; }> = ({ label, icon: Icon, onClick }) => (
    <button onClick={onClick} className="flex items-center space-x-3 w-full text-left p-4 bg-gray-200/75 hover:bg-gray-300/75 rounded-lg transition-colors">
        {Icon && <Icon size={20} className="text-gray-600 flex-shrink-0" />}
        <span className="font-medium text-sm text-gray-800">{label}</span>
    </button>
);


const Service: React.FC = () => {
  const [remoteStart, setRemoteStart] = React.useState(false);
  const popup = usePopup();

  const handleActionClick = (title: string) => {
      const description = descriptions[title as keyof typeof descriptions];
      if (description) {
          popup.showPopup({ title, description });
      }
  };

  const serviceActions = [
    { label: "Manuale d'uso", icon: BookOpen },
    { label: "Manutenzione tergicristalli" },
    { label: "Modalit autolavaggio" },
    { label: "Regola fari anteriori" },
    { label: "Traino" },
    { label: "Ruote e pneumatici" },
    { label: "Notifiche" },
    { label: "Anteprima telecamera" },
    { label: "Calibraz. sedile, sterzo e specchietti" },
    { label: "Ripristino fabbrica" },
    { label: "Cancella dati di navigazione" },
    { label: "Calibrazione telecamere" },
  ];

  return (
    <div className="max-w-4xl mx-auto">
      {/* Vista auto e pressione pneumatici */}
      <div className="relative flex justify-center items-center py-16 mb-8">
        <div className="relative w-48 grid">
          <div className="col-start-1 row-start-1 bg-gray-100 rounded-lg"></div>
          {/* Sagoma generica di un'auto in SVG */}
          <img 
            src={carImageBase64} 
            alt="Vista dall'alto dell'auto" 
            className="w-full h-auto col-start-1 row-start-1" 
          />
          <TirePressureDisplay pressure="2.5 bar" time="36 minuti fa" position="top-[-40px] left-[-110px]" />
          <TirePressureDisplay pressure="2.5 bar" time="36 minuti fa" position="top-[-40px] right-[-110px]" />
          <TirePressureDisplay pressure="2.5 bar" time="36 minuti fa" position="bottom-[-40px] left-[-110px]" />
          <TirePressureDisplay pressure="2.5 bar" time="36 minuti fa" position="bottom-[-40px] right-[-110px]" />
        </div>
      </div>

      {/* Griglia azioni di servizio */}
      <div className="grid grid-cols-2 gap-3 mb-6">
        {serviceActions.map((action) => (
          <ServiceGridButton 
            key={action.label} 
            label={action.label} 
            icon={action.icon}
            onClick={() => handleActionClick(action.label)}
          />
        ))}
      </div>

      {/* Toggle Avvio a Distanza */}
      <SettingsRow title="Consenti a Tesla l'avvio a distanza" showInfo border={false}>
        <ToggleButton checked={remoteStart} onChange={setRemoteStart} />
      </SettingsRow>
    </div>
  );
};

export default Service;